/*Table structure for table `acode_cate` */

DROP TABLE IF EXISTS `acode_cate`;

CREATE TABLE `acode_cate` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '激活码名称',
  `prize` text COLLATE utf8_unicode_ci COMMENT '礼品json格式',
  `type_id` tinyint(3) unsigned NOT NULL COMMENT '类型10=共用 20=特殊',
  `channel` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '渠道ID',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0=关闭 100=开启中',
  `start_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '开始时间',
  `stop_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '结束时间',
  `common_code` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公用激活码',
  `total_got` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '总获取人数',
  `total_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '总发行量',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `type_id` (`type_id`),
  KEY `status` (`status`),
  KEY `start_time` (`start_time`),
  KEY `stop_time` (`stop_time`),
  KEY `common_code` (`common_code`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='激活码分类表';

