/*Table structure for table `acode_log` */

DROP TABLE IF EXISTS `acode_log`;

CREATE TABLE `acode_log` (
  `cate_id` int(10) unsigned NOT NULL COMMENT '分类ID',
  `user_id` bigint(20) unsigned NOT NULL COMMENT '玩家ID',
  `channel` int(10) unsigned NOT NULL COMMENT '渠道ID',
  `sdk_uid` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '渠道UID',
  `gz_id` int(10) unsigned NOT NULL COMMENT '游服ID',
  `code` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '原始激活码',
  `got_time` int(10) unsigned NOT NULL COMMENT '获取时间',
  PRIMARY KEY (`cate_id`,`user_id`),
  KEY `got_time` (`got_time`),
  KEY `cate_id` (`cate_id`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='激活码日志';

