  KEY `_v` (`_v`) USING BTREE,
  KEY `code` (`code`) USING BTREE,
  KEY `sign` (`sign`(333)) USING BTREE,
  KEY `lab` (`lab`) USING BTREE,
  KEY `create_time` (`create_time`) USING BTREE,
  KEY `serverid` (`serverid`) USING BTREE
