/*Table structure for table `kqgcharge` */

DROP TABLE IF EXISTS `kqgcharge`;

CREATE TABLE `kqgcharge` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `account_id` int(10) unsigned NOT NULL COMMENT '凯奇谷SDK平台ID',
  `order_no` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '平台订单号',
  `product_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '商品名称',
  `amount` decimal(10,2) NOT NULL COMMENT '支付金额，单位元',
  `currency` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '货币类型',
  `pay_tp` int(11) NOT NULL COMMENT '支付平台',
  `ticket` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '静静传的票据',
  `game_user_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Role_Id',
  `server_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '服务器 ID',
  `product_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '商品 ID',
  `appid` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ext中传的appid',
  `create_time` int(10) unsigned NOT NULL COMMENT '接收时间',
  `status` tinyint(4) NOT NULL DEFAULT '10' COMMENT '状态 10=未核销 100=已核销',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_id` (`order_no`),
  KEY `game_user_id` (`game_user_id`),
  KEY `server_id` (`server_id`),
  KEY `product_id` (`product_id`),
  KEY `order_id_2` (`order_no`,`game_user_id`),
  KEY `ticket` (`ticket`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

