/*Table structure for table `server` */

DROP TABLE IF EXISTS `server`;

CREATE TABLE `server` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dsp_id` int(11) NOT NULL DEFAULT '0' COMMENT '显示ID',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态 0=关闭 100=正常',
  `dsp_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '显示状态 0=不显示 100=显示',
  `url` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '游戏api地址',
  `url_auth` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '内网接口地址',
  `name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '游戏服务器名称',
  `chat_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '融云聊天室ID',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  `loading_lev` tinyint(4) NOT NULL DEFAULT '0' COMMENT '游戏服务器负载值 0~3',
  `count_ol` int(10) unsigned NOT NULL DEFAULT '0',
  `ol_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '在线信息获取时间',
  `is_new` tinyint(4) NOT NULL DEFAULT '0' COMMENT '新区 0=否1=是',
  `is_default` tinyint(4) NOT NULL DEFAULT '0' COMMENT '默认 0=否1=是',
  `minver` int(11) NOT NULL DEFAULT '0' COMMENT '该区最低版本',
  PRIMARY KEY (`id`),
  KEY `status` (`status`),
  KEY `dsp_status` (`dsp_status`)
) ENGINE=MyISAM AUTO_INCREMENT=2042 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

